import React from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import "./imageSlider.css"

const ImageSlider = () => {
  let settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slideToShow: 1,
    slideToScroll: 1,
    autoplay: true,
    arrows:false
    
  };
  return (
    <div className="bg-red-500 ">
      <Slider {...settings} className="container slider mx-auto">
        <div className="slider-img">
          <a href="/">
            <img src="/assets/images/bg-jhon-wick.jpg" alt="" />
          </a>
        </div>
        <div className="slider-img">
          <a href="/">
            <img src="/assets/images/bg-breaking-bad.jpg" alt="" />
          </a>
        </div>
        <div className="slider-img">
          <a href="/">
            <img src="/assets/images/hxh.webp" alt="" />
          </a>
        </div>
      </Slider>
    </div>

  );
};

export default ImageSlider;
